import React from "react";
import Header from "../components/header/Header";

function Profile() {
    return(
        <div>
            <Header></Header>
            <div>
                <h2>Личные данные</h2>
                <form>
                    <div>
                        <h3>Имя</h3>
                        <input type="text" size="20"></input>
                    </div>
                    <div>
                        <h3>Фамилия</h3>
                        <input type="text" size="20"></input>
                    </div>
                    

                </form>
            </div> 
        </div>
    )
}

export default Profile;
